import { useState,useEffect } from "react";
import { Link } from "react-router-dom";


function Movies() {
    const [movies, setMovies] = useState([]);

    useEffect(() => {
        let movieList = [
            {
                id: 1,
                title: "Heartbreakers",
                release_date: "2001-03-23",
                runetime: 120,
                mpaa_rating: "PG-13",
                description: "Movie about ewhoring"
            },
            {
                id: 2,
                title: "Spider=Man",
                release_date: "2002-06-03",
                runetime: 120,
                mpaa_rating: "PG-13",
                description: "Movie about spiderman"
            },
        ];
        setMovies(movieList)
    },[]);
    return (
        <>
            <div>
                <h2>Movies</h2>
                <hr></hr>
                <table className="table table-stripped table-hover">
                    <thead>
                        <tr>
                            <th>Movie</th>
                            <th>Relase Date</th>
                            <th>Rating</th>
                        </tr>
                    </thead>
                    <tbody>
                        {movies.map((movie) => (
                            <tr key={movie.id}>
                                <td>
                                    <Link to={`/movies/${movie.id}`}>
                                        {movie.title}
                                    </Link>
                                </td>
                                <td>
                                    {movie.release_date}
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </>
      );
}

export default Movies;
